import React from 'react';
import ContactCard from "../../components/ContactCard/ContactCard";
import { PhoneIcon, MailIcon, LocationIcon } from "../../assets/icons";

import "./Contact.scss";

const data = [
    {
        id: 0,
        icon: PhoneIcon,
        title: "",
        text: ""
    },

    {
        id: 1,
        icon: MailIcon,
        title: "",
        text: ""
    },

    {
        id: 2,
        icon: LocationIcon,
        title: "",
        text: ""
    },
]

const Contact = () => {
    return (
        <div className="Contact container">
            <ContactCard icon={PhoneIcon} title="Make a Phone Call" text="+998 99 299 99 96" />
        </div>
    )
}

export default Contact;
